import { API } from "../../config/api";
import { useQuery } from "react-query";
import CardPopular from "../../compnents/card/CardPopular";

//useQuery = method GET
//useMutation = method POST, PUT, PATCH & DELETE

const Multer = () => {
	const {
		data: restaurantData,
		error: restaurantError,
		loading: restaurantLoading,
		refetch: restaurantRefetch,
	} = useQuery("restaurantsCache", async () => {
		return API.get("/restaurants-fav");
	});

	return (
		<div>
			<div className="row ">
				<div className="my-2 col-12">
					<h2>Popular Restaurant</h2>
				</div>

				{restaurantLoading ? (
					<tr>
						<td colSpan="4">Loading Data</td>
					</tr>
				) : (
					restaurantData?.data?.data?.restaurants?.map((restaurant, index) => (
						<CardPopular data={restaurant} index={index} key={restaurant.id} />
					))
				)}
			</div>
		</div>
	);
};

export default Multer;
